import React from 'react';

function Carusele({ text }) {
	return (
		<main className="carusele">
			<div>
				<div>{text}</div>
				<div></div>
			</div>
			<div
				style={{
					display: 'flex',

				}}
			>
				<div>1</div>
				<div>2</div>
				<div>3</div>
			</div>
		</main>
	);
}

export default Carusele;
